import React, { useContext } from 'react';
import { Transaction } from './Transaction';

import { GlobalContext } from '../context/GlobalState';

export const TransactionList = () => {
  const { transactions,symbol_list } = useContext(GlobalContext);

  return (
    <>
      <h3>History</h3>
      <ul className="list">
        {symbol_list.map(symbol => (<Transaction key={symbol.symbol} transaction={symbol.name} />))}
      </ul>
    </>
  )
}
